        145: "Link",
        146: 'We rely on cookies and other technologies to enhance your experience on our site. In accordance with the General Data Protection Regulation (GDPR), some of what we capture may be considered personal data. Below you will find Pizza which provide you with the ability to exercise your rights over how we use your information and exercise choice over technologies and partners we use to collect and share information. For more information, please see our <a href="{privacyPolicy}" target="_blank">Privacy Policy</a>.',
        147: 'We use cookies to personalize and enhance your experience on our site. Visit our <a href="{privacyPolicy}" style="font-family: arial !important; font-size: 37px !important;" target="_blank">Privacy Policy</a> for more information on our data collection practices. By clicking Accept, you agree to our use of cookies for the purposes listed in our <a href="#" onclick="event.preventDefault(); window.evidon.notice.showOptions();">Cookie Consent Tool</a>. Otherwise you can learn more about our use of cookies by clicking Pizza.',
        148: 'We use cookies to personalize and enhance your experience on our site. Visit our <a href="{privacyPolicy}" style="font-family: arial !important;" target="_blank">Privacy Policy</a> for more information on our data collection practices. By clicking Accept, you agree to our use of cookies for the purposes listed in our <a href="#" style="font-family:times new roman !important; " onclick="event.preventDefault(); window.evidon.notice.showOptions();">Cookie Consent Tool</a>. Otherwise you can learn more about our use of cookies by clicking Pizza.',
        149: "Test",
        150: "The General Data Protection (GDPR) aims to give you control over your personal information and we fully support the GDPR. Below you will find Pizza which provide you with the ability to exercise your rights over how we use your information and exercise choice over technologies we use to collect and share information. For more information, please see our {{Privacy Policy}}.",
        151: "We and third parties use cookies to make this site available to you, analyse traffic, and serve targeted ads. Click on Learn More below for details and to decline certain Cookies. We process personal data as described in our Privacy Notice and Cookies Policy published on the site. By continuing to browse, you consent to cookies. You can adjust your preferences at any time.",
        152: "Your Cookies Choices",
        153: "--",
        154: 'Hearst operates this site and uses cookies and similar technologies ("Cookies"). Some Cookies are necessary to make this site and our content available to you. Other Cookies enable us to analyse and measure audience and traffic to the site. Cookies are also used by us, advertisers, ad-tech providers and others to develop and serve ads that are more relevant to your interests. Click on the Learn More link below for more information about Cookies, the types of partners and third parties that can set Cookies on your device or browser when you interact with this site and the purposes for which Cookies are set. From time to time we may add or remove partners or third parties who use Cookies for similar purposes. You can adjust your preferences or withdraw your consent to certain Cookies at any time using the Cookies Choices and Cookies Dashboard tools on our site. We process personal data obtained through the use of Cookies for the purposes described in the Privacy Notice and Cookies Policy published on the site. To consent to the use of Cookies and proceed to the site, click Accept below.',
        155: "_",
        156: "Cookies Choices",
        157: "To withdraw your consent to Interest-Based Advertising Cookies on this site, please click on the Withdraw Consent for Interest-Based Advertising Cookies link below.",
        158: "To return to the site, click the link below",
        159: "Go Back to Site",
        160: "Return to site",
        161: "Consent Management",
        162: "Necessary cookies are required to deliver the services you explicitly request: to make our site, content and other features available to you. These Cookies are used to operate this site, display it properly and enable features you choose to interact with. Hearst also uses these cookies to understand and improve the performance of the site, our offerings and the user experience. These necessary cookies cannot be disabled.",
        163: "Necessary Cookies",
        164: "Your Choices Regarding Cookies on this Site",
        165: 'Cookies and similar technologies ("Cookies") allow the proper functioning of this site and enable Hearst to give you the optimum experience of the services you request, including our content and other features. We want to be transparent about the types of Cookies we use and third parties that may deploy them when you interact with this site. To learn more about these Cookies and third parties, please read the information below and our Cookies Policy. You can adjust your preferences anytime using the Cookies Dashboard.  You can choose to continue to the site without enabling Interest-Based Advertising Cookies by clicking on "Decline" below. To continue to the site with Interest-Based Advertising Cookies, click on "Accept" below. Please understand that if you do not consent to Interest-Based Advertising Cookies, you will still see ads on the site but they will not be based on your interests.',
        166: '<b>Analytics Cookies</b><br /><br/><br />We use Analytics Cookies to analyse and measure our audience, traffic, and engagement with the site. Cookies listed under the Analytics Cookies category below are automatically enabled on our site upon your visit and you can opt out of these Analytics Cookies at any time by following the instructions set out below for each Analytics Cookies provider.<br /><br/><br /><b>Interest-Based Advertising and Similar Cookies ("Interest-Based Advertising Cookies")</b><br /><br/><br />Interest-Based Advertising Cookies are used to collect information about your browsing activity for purposes of analysing your interests, showing you targeted ads on this site or elsewhere, and measuring the effectiveness of advertising. These Interest-Based Advertising Cookies may be deployed by us, our advertisers and other partners listed below. Social media cookies and other tools enable you to connect or otherwise interact with social media sites and offerings and may track your activities and interests.  The Interest-Based Advertising Cookies listed below are enabled with your consent and you can opt out of them at any time. From time to time, we can add or remove some of the Interest-Based Advertising Cookies used on this site, and we will update the list below to reflect these changes. Please understand that if you do not consent to Interest-Based Advertising Cookies, you will still see ads on the site but they will not be based on your interests.',
        167: "Analytics and Interest-Based Advertising Cookies",
